def can_form_consecutive_months(n, days_sequence):
    p1 = [31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31]
    p2 = [31, 29, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31]
    cp1 = p2 + p1 - p1
    cp2 = p1 + p2 + p1
    cp3 = p1 + p1 + p2

    def check_sequence(cp):
        for i in range(len(cp) - n + 1):
            if cp[i] == days_sequence[0]:
                j = i + 1
                length = 1
                while length < n and j < len(cp):
                    if days_sequence[length] != cp[j]:
                        break
                    length += 1
                    j += 1
                if length == n:
                    return True
        return False
    if check_sequence(cp1) or check_sequence(cp2) or check_sequence(cp3):
        return 'YES'
    else:
        return 'NO'

